#
# TABLE STRUCTURE FOR: agama
#

DROP TABLE IF EXISTS `agama`;

CREATE TABLE `agama` (
  `id_agama` int(11) NOT NULL AUTO_INCREMENT,
  `nama_agama` text NOT NULL,
  PRIMARY KEY (`id_agama`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: artikel
#

DROP TABLE IF EXISTS `artikel`;

CREATE TABLE `artikel` (
  `id_artikel` int(11) NOT NULL AUTO_INCREMENT,
  `slug` varchar(99) NOT NULL,
  `judul` varchar(99) NOT NULL,
  `id_user` int(11) NOT NULL,
  `id_kategori` int(11) NOT NULL,
  `keterangan` text NOT NULL,
  `date` date NOT NULL,
  `views` int(11) NOT NULL,
  `gambar` varchar(99) NOT NULL,
  PRIMARY KEY (`id_artikel`),
  KEY `id_user` (`id_user`),
  KEY `id_kategori` (`id_kategori`),
  CONSTRAINT `artikel_ibfk_1` FOREIGN KEY (`id_user`) REFERENCES `user` (`id_user`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `artikel_ibfk_2` FOREIGN KEY (`id_kategori`) REFERENCES `kategori` (`id_kategori`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: daftar_pelatihan
#

DROP TABLE IF EXISTS `daftar_pelatihan`;

CREATE TABLE `daftar_pelatihan` (
  `id_daftarpelatihan` int(11) NOT NULL AUTO_INCREMENT,
  `id_pelatihan` int(11) DEFAULT NULL,
  `id_user` int(11) DEFAULT NULL,
  `date` datetime DEFAULT NULL,
  PRIMARY KEY (`id_daftarpelatihan`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: jabatan
#

DROP TABLE IF EXISTS `jabatan`;

CREATE TABLE `jabatan` (
  `id_jabatan` int(11) NOT NULL AUTO_INCREMENT,
  `nama_jabatan` text NOT NULL,
  PRIMARY KEY (`id_jabatan`)
) ENGINE=InnoDB AUTO_INCREMENT=392 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: jenis_badan_usaha
#

DROP TABLE IF EXISTS `jenis_badan_usaha`;

CREATE TABLE `jenis_badan_usaha` (
  `id_jbu` int(100) NOT NULL AUTO_INCREMENT,
  `nama_jbu` text NOT NULL,
  PRIMARY KEY (`id_jbu`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: jurusan
#

DROP TABLE IF EXISTS `jurusan`;

CREATE TABLE `jurusan` (
  `id_jurusan` int(11) NOT NULL AUTO_INCREMENT,
  `nama_jurusan` varchar(99) NOT NULL,
  `rumpun` char(10) NOT NULL,
  PRIMARY KEY (`id_jurusan`)
) ENGINE=InnoDB AUTO_INCREMENT=2857 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: kabupaten
#

DROP TABLE IF EXISTS `kabupaten`;

CREATE TABLE `kabupaten` (
  `id_kabupaten` int(11) NOT NULL AUTO_INCREMENT,
  `id_provinsi` int(11) NOT NULL,
  `kabupaten` varchar(50) NOT NULL,
  PRIMARY KEY (`id_kabupaten`)
) ENGINE=InnoDB AUTO_INCREMENT=515 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: kategori
#

DROP TABLE IF EXISTS `kategori`;

CREATE TABLE `kategori` (
  `id_kategori` int(11) NOT NULL AUTO_INCREMENT,
  `kategori` varchar(99) NOT NULL,
  PRIMARY KEY (`id_kategori`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: kecamatan
#

DROP TABLE IF EXISTS `kecamatan`;

CREATE TABLE `kecamatan` (
  `id_kecamatan` int(11) NOT NULL AUTO_INCREMENT,
  `id_kabupaten` int(11) NOT NULL,
  `kecamatan` varchar(50) NOT NULL,
  PRIMARY KEY (`id_kecamatan`)
) ENGINE=InnoDB AUTO_INCREMENT=7098 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: komentar_artikel
#

DROP TABLE IF EXISTS `komentar_artikel`;

CREATE TABLE `komentar_artikel` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_artikel` int(11) NOT NULL,
  `nama` varchar(22) NOT NULL,
  `email` varchar(22) NOT NULL,
  `komentar` text NOT NULL,
  `date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;

#
# TABLE STRUCTURE FOR: lamar
#

DROP TABLE IF EXISTS `lamar`;

CREATE TABLE `lamar` (
  `id_lamar` int(11) NOT NULL AUTO_INCREMENT,
  `id_lowongan` int(11) DEFAULT NULL,
  `id_user` int(11) DEFAULT NULL,
  `berkas_tambahan` varchar(99) DEFAULT NULL,
  `id_status_lamar` int(11) DEFAULT NULL,
  `id_pencaker` int(11) DEFAULT NULL,
  `date` datetime DEFAULT NULL,
  PRIMARY KEY (`id_lamar`),
  KEY `id_user` (`id_user`),
  KEY `id_lowongan` (`id_lowongan`),
  KEY `id_status_lamar` (`id_status_lamar`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: lowongan
#

DROP TABLE IF EXISTS `lowongan`;

CREATE TABLE `lowongan` (
  `id_lowongan` int(11) NOT NULL AUTO_INCREMENT,
  `disediakanuntuk` text NOT NULL,
  `id_jabatan` int(11) NOT NULL,
  `judul_lowongan` text NOT NULL,
  `deskripsi_lowongan` text NOT NULL,
  `id_sektor` int(50) NOT NULL,
  `tgl_buka_loker` date NOT NULL,
  `tgl_tutup_loker` date NOT NULL,
  `lokasi_lowongan` text NOT NULL,
  `id_jurusan` text NOT NULL,
  `id_pendidikan` int(11) NOT NULL,
  `jumlah` int(20) NOT NULL,
  `nama_pj` text NOT NULL,
  `status` varchar(50) NOT NULL,
  `jenis_lowongan` varchar(50) NOT NULL,
  `id_user` text NOT NULL,
  `tgl_seleksi_administrasi` date DEFAULT NULL,
  `tgl_seleksi_wawancara` date DEFAULT NULL,
  `date` datetime DEFAULT NULL,
  PRIMARY KEY (`id_lowongan`)
) ENGINE=InnoDB AUTO_INCREMENT=87 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: pelatihan
#

DROP TABLE IF EXISTS `pelatihan`;

CREATE TABLE `pelatihan` (
  `id_pelatihan` int(11) NOT NULL AUTO_INCREMENT,
  `kategori` varchar(20) NOT NULL,
  `nama_pelatihan` varchar(99) NOT NULL,
  `jumlah_peserta` varchar(50) DEFAULT NULL,
  `tanggal` date NOT NULL,
  `deskripsi_pelatihan` text NOT NULL,
  `alamat` varchar(150) NOT NULL,
  `jam` varchar(15) NOT NULL,
  `status` varchar(100) NOT NULL,
  `id_user` int(11) NOT NULL,
  `sertifikat` varchar(100) NOT NULL,
  PRIMARY KEY (`id_pelatihan`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: pencari_kerja
#

DROP TABLE IF EXISTS `pencari_kerja`;

CREATE TABLE `pencari_kerja` (
  `id_pencaker` int(50) NOT NULL AUTO_INCREMENT,
  `id_user` int(50) DEFAULT NULL,
  `nik_pencaker` int(50) DEFAULT NULL,
  `tempat_lahir` text DEFAULT NULL,
  `tanggal_lahir` date DEFAULT NULL,
  `id_agama` int(50) DEFAULT NULL,
  `jenis_kelamin` text DEFAULT NULL,
  `tinggi_badan` int(10) DEFAULT NULL,
  `berat_badan` int(10) DEFAULT NULL,
  `id_status_perkawinan` int(50) DEFAULT NULL,
  `id_provinsi` int(50) DEFAULT NULL,
  `id_kabupaten` int(11) DEFAULT NULL,
  `id_kecamatan` int(11) DEFAULT NULL,
  `kodepos` int(20) DEFAULT NULL,
  `id_pendidikan` int(50) DEFAULT NULL,
  `id_jurusan` int(50) DEFAULT NULL,
  `tahun_lulus` text DEFAULT NULL,
  `id_jabatan` int(50) DEFAULT NULL,
  `pengalaman_kerja` text DEFAULT NULL,
  `nama_tempat_kerja_terakhir` text DEFAULT NULL,
  `posisi_terakhir` varchar(50) DEFAULT NULL,
  `tahun_masuk` int(15) DEFAULT NULL,
  `tahun_keluar` int(15) DEFAULT NULL,
  `upload_cv` text DEFAULT NULL,
  `upload_sertifikat` text DEFAULT NULL,
  `berkas_domisili` varchar(99) NOT NULL,
  `date` date DEFAULT NULL,
  PRIMARY KEY (`id_pencaker`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: pendidikan
#

DROP TABLE IF EXISTS `pendidikan`;

CREATE TABLE `pendidikan` (
  `id_pendidikan` int(11) NOT NULL AUTO_INCREMENT,
  `nama_pendidikan` text NOT NULL,
  PRIMARY KEY (`id_pendidikan`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: penyedia_pelatihan
#

DROP TABLE IF EXISTS `penyedia_pelatihan`;

CREATE TABLE `penyedia_pelatihan` (
  `id_penyediapelatihan` int(11) NOT NULL AUTO_INCREMENT,
  `id_user` int(11) DEFAULT NULL,
  `id_provinsi` int(11) DEFAULT NULL,
  `id_kabupaten` int(11) DEFAULT NULL,
  `id_kecamatan` int(11) DEFAULT NULL,
  `kode_pos` int(11) DEFAULT NULL,
  `nama_pjpp` varchar(99) DEFAULT NULL,
  `notelp_pjpp` int(15) DEFAULT NULL,
  PRIMARY KEY (`id_penyediapelatihan`),
  KEY `id_kabupaten` (`id_kabupaten`),
  KEY `id_kecamatan` (`id_kecamatan`),
  KEY `id_provinsi` (`id_provinsi`),
  KEY `id_user` (`id_user`),
  CONSTRAINT `penyedia_pelatihan_ibfk_1` FOREIGN KEY (`id_kabupaten`) REFERENCES `kabupaten` (`id_kabupaten`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `penyedia_pelatihan_ibfk_2` FOREIGN KEY (`id_kecamatan`) REFERENCES `kecamatan` (`id_kecamatan`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `penyedia_pelatihan_ibfk_3` FOREIGN KEY (`id_provinsi`) REFERENCES `provinsi` (`id_provinsi`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `penyedia_pelatihan_ibfk_4` FOREIGN KEY (`id_user`) REFERENCES `user` (`id_user`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: perusahaan
#

DROP TABLE IF EXISTS `perusahaan`;

CREATE TABLE `perusahaan` (
  `id_perusahaan` int(100) NOT NULL AUTO_INCREMENT,
  `deskripsi_perusahaan` text DEFAULT NULL,
  `id_jbu` int(100) DEFAULT NULL,
  `nib` int(100) DEFAULT NULL,
  `id_sektor` int(100) DEFAULT NULL,
  `id_provinsi` int(100) DEFAULT NULL,
  `id_kabupaten` int(100) DEFAULT NULL,
  `id_kecamatan` int(100) DEFAULT NULL,
  `kode_pos` int(50) DEFAULT NULL,
  `nama_pj` text DEFAULT NULL,
  `nohp_pj` int(50) DEFAULT NULL,
  `jabatan_pj` text DEFAULT NULL,
  `id_user` int(99) DEFAULT NULL,
  PRIMARY KEY (`id_perusahaan`),
  KEY `id_kabupaten` (`id_kabupaten`),
  KEY `id_kecamatan` (`id_kecamatan`),
  KEY `id_provinsi` (`id_provinsi`),
  KEY `id_user` (`id_user`),
  CONSTRAINT `perusahaan_ibfk_1` FOREIGN KEY (`id_kabupaten`) REFERENCES `kabupaten` (`id_kabupaten`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `perusahaan_ibfk_2` FOREIGN KEY (`id_kecamatan`) REFERENCES `kecamatan` (`id_kecamatan`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `perusahaan_ibfk_3` FOREIGN KEY (`id_provinsi`) REFERENCES `provinsi` (`id_provinsi`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `perusahaan_ibfk_4` FOREIGN KEY (`id_user`) REFERENCES `user` (`id_user`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: provinsi
#

DROP TABLE IF EXISTS `provinsi`;

CREATE TABLE `provinsi` (
  `id_provinsi` int(11) NOT NULL AUTO_INCREMENT,
  `provinsi` varchar(50) NOT NULL,
  `ibukota` varchar(50) NOT NULL,
  PRIMARY KEY (`id_provinsi`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: sektor
#

DROP TABLE IF EXISTS `sektor`;

CREATE TABLE `sektor` (
  `id_sektor` int(100) NOT NULL AUTO_INCREMENT,
  `nama_sektor` text NOT NULL,
  PRIMARY KEY (`id_sektor`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: setting
#

DROP TABLE IF EXISTS `setting`;

CREATE TABLE `setting` (
  `web` varchar(99) NOT NULL,
  `keyword` varchar(99) NOT NULL,
  `logo` varchar(99) NOT NULL,
  `alamat` text NOT NULL,
  `telp` varchar(15) NOT NULL,
  `email` varchar(99) NOT NULL,
  `yt` varchar(99) NOT NULL,
  `ig` varchar(99) NOT NULL,
  `fb` varchar(99) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: status_loker
#

DROP TABLE IF EXISTS `status_loker`;

CREATE TABLE `status_loker` (
  `id_status_lowongan` int(100) NOT NULL AUTO_INCREMENT,
  `nama_status_lowongan` text NOT NULL,
  PRIMARY KEY (`id_status_lowongan`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: status_pelamar
#

DROP TABLE IF EXISTS `status_pelamar`;

CREATE TABLE `status_pelamar` (
  `id_status_lamar` int(11) NOT NULL AUTO_INCREMENT,
  `nama_status_lamar` text NOT NULL,
  PRIMARY KEY (`id_status_lamar`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: status_perkawinan
#

DROP TABLE IF EXISTS `status_perkawinan`;

CREATE TABLE `status_perkawinan` (
  `id_status_perkawinan` int(11) NOT NULL AUTO_INCREMENT,
  `nama_status_perkawinan` text NOT NULL,
  PRIMARY KEY (`id_status_perkawinan`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: user
#

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id_user` int(10) NOT NULL AUTO_INCREMENT,
  `nama_user` varchar(99) DEFAULT NULL,
  `username` varchar(99) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `level` int(5) DEFAULT NULL,
  `foto_user` varchar(99) DEFAULT NULL,
  `email_user` varchar(50) DEFAULT NULL,
  `nohp_user` varchar(15) DEFAULT NULL,
  `alamat_user` text DEFAULT NULL,
  PRIMARY KEY (`id_user`)
) ENGINE=InnoDB AUTO_INCREMENT=117 DEFAULT CHARSET=utf8mb4;



